de.description:
Tritt ein in die detailreiche Welt der winzigen Kreationen und lass dich von @TheSquareToSpare durch das Museum der Miniaturen führen! 🏛️🎨✨

Vielseitige Ideen und unfassbare Fingerfertigkeit – das ist die Miniatur-Community: Lass dich von unserer Gastgeberin, ihres Zeichens selbst eine bekannte Miniaturkünstlerin, auf eine beeindruckende Reise mitnehmen. Dabei kannst du zusehen, wie Miniaturkünstlerinnen und  Miniaturkünstler aus aller Welt ihre Ideen zum Leben erwecken. Ob erfahrene Miniatur-Fans oder Neueinsteiger – in unserem winzigen Museum sind alle herzlich willkommen. 

Dieses Video wurde mit Universal Dubbing (ehemals Universal Translator), einem KI-gestützten Synchronisationsdienst, synchronisiert. Barrierefreie Videos mit Universal Translator →https://www.youtube.com/watch?v=S-iIV5Oo0n0

